var accordionCss="\n<h5>Containers</h5>\n<code>\n<pre>\n/* Containers */\n.accordion-group-toggle {\n  border-bottom: 1px solid #ebebeb;\n  justify-content: flex-end;\n  padding: 24px 48px 24px 24px;\n  align-items: center;\n  display: flex;\n  font-family: \"Open Sans\", sans-serif;\n}\n.accordion-group-toggle-content {\n  height: 32px;\n  align-items: center;\n  display: flex;\n  outline: none;\n}\n.accordion-item-tile {\n  border-bottom: 1px solid #ebebeb;\n  box-sizing: border-box;\n  transition: background-color 0.5s;\n  background-color: #ffffff;\n}\n.accordion-item-tile-content {\n  align-items: center;\n  display: flex;\n  justify-content: space-between;\n  padding: 32px;\n}\n.accordion .icon-container {\n  align-items: center;\n  background-color: #f5c550;\n  border: none;\n  border-radius: 3.125rem;\n  box-shadow: 0 0.125rem 0.25rem rgba(0, 0, 0, 0.1);\n  color: #000;\n  cursor: pointer;\n  display: flex;\n  font-weight: 500;\n  justify-content: center;\n  outline: none;\n  padding: 16px;\n  position: relative;\n  transition: all 0.3s ease 0s;\n}\n.accordion-item-content {\n  display: none;\n  transition-property: transform, -webkit-transform;\n  transition-duration: 0.4s, 0.4s;\n  transition-timing-function: ease, ease;\n  transition-delay: 0s, 0s;\n  max-height: 0;\n  overflow: hidden;\n  transition: height 0.8s, background-color 0.5s;\n  padding: 0 112px 32px 32px;\n}\n.accordion-item-banner {\n  background-color: #ffd964;\n  height: 0;\n  position: absolute;\n  transition: height 0.2s;\n  width: 100%;\n  z-index: 1;\n}\n.accordion-item-content.visible {\n  display: block;\n  background-color: #ebebeb !important;\n  border-bottom: solid 4px #ffd964;\n  max-height: none;\n}\n.accordion-item.open .accordion-item-tile {\n  background-color: #ebebeb !important;\n}\n.accordion-item-tile:focus,\n.accordion-item-tile:hover {\n  background-color: #ebebeb;\n  cursor: pointer;\n  outline: none;\n}\n.accordion-item.open .accordion-item-tile,\n.accordion-item.open .accordion-item-tile:hover,\n.accordion-item.open .accordion-item-tile:focus {\n  border-bottom: none !important;\n}\n.accordion-item-tile:hover,\n.accordion-item-tile:focus {\n  border-bottom: solid 4px #ffd964 !important;\n}\n.accordion-item-tile:focus .icon-container,\n.accordion-item-tile:hover .icon-container,\n.accordion-item.open .accordion-item-tile-content .icon-container {\n  background-color: #ffd964;\n  box-shadow: 0 0.25rem 0.5rem rgba(0, 0, 0, 0.2);\n  transform: translateY(-0.125rem);\n}\n</pre>\n</code>\n\n<h5>Text</h5>\n<code>\n<pre>\n/* Text */\n.accordion .title {\n  font-family: \"Open Sans\", sans-serif;\n  font-weight: 600;\n  font-style: normal;\n  color: #666;\n  font-size: 16px;\n  transition: all 0.3s ease 0s;\n  box-shadow: none;\n  font-stretch: normal;\n  letter-spacing: 0;\n  line-height: 1.75;\n}\n.accordion-group-toggle-content .title {\n  font-weight: 600;\n  line-height: 2;\n  margin: 0 8px 0 0;\n  padding-bottom: 0;\n}\n.accordion-item-tile-content .title {\n  max-width: 100%;\n  margin: 0;\n}\n.accordion-group-toggle-content:hover .title,\n.accordion-group-toggle-content:focus .title {\n  box-shadow: inset 0 -0.11rem 0 #666;\n  cursor: pointer;\n  line-height: 1.38;\n}\n.accordion-item .accordion-item-tile:hover .title,\n.accordion-item .accordion-item-tile:focus .title,\n.accordion-item.open .accordion-item-tile-content .title {\n  color: #000;\n}\n.accordion-item .accordion-item-tile:hover .title,\n.accordion-item .accordion-item-tile:focus .title {\n  box-shadow: inset 0 -2.08px 0 #666666;\n}\n.accordion p {\n  color: #333;\n  overflow-wrap: break-word;\n  word-break: break-word;\n  font-family: \"Open Sans\", sans-serif;\n  padding: 0 0 32px 0;\n  margin: 0;\n  line-height: 1.71;\n}\n.accordion ul {\n  padding: 0 0 0 16px;\n  margin: 0;\n  font-size: 16px;\n  line-height: 1.78;\n  list-style: none;\n}\n.accordion ul li {\n  padding: 0 0 16px 16px;\n  margin: 0;\n  position: relative;\n}\n.accordion-item-content > *:last-child {\n  padding-bottom: 0;\n}\n.accordion-item-content > *:last-child li:last-of-type {\n  padding-bottom: 0;\n}\n.accordion ul li svg {\n  position: absolute;\n  top: 6px;\n  left: 0px;\n}\n.accordion ul li p {\n  display: block;\n  padding-left: 16px;\n  padding-bottom: 0px;\n}\n</pre>\n</code>\n\n<h5>Icon</h5>\n<code>\n<pre>\n/* Icon */\n.accordion .arrow-icon {\n  line-height: 0.5;\n}\n.accordion-group-toggle-content.all-open .arrow-icon,\n.accordion-item.open .accordion-item-tile .arrow-icon {\n  transform: scaleY(-1);\n}\n.accordion-item-tile .arrow-icon svg {\n  fill: #333;\n  transition: transform 0.3s;\n}\n</pre>\n</code>\n";$(".accordion-code .css-code").html(accordionCss); //FEATURE BOX
