var featureBoxNewsCss="\n<h5>Container</h5>\n<code>\n<pre>\n/* Container */\n.feature-box {\n    height: auto;\n    border-top: none;\n    background: none;\n    padding: 32px 120px 32px 152px;\n    border-top: 4px solid #E1AA21;\n    background: #FFF0C1;\n    font-family: \"Open Sans\", sans-serif;\n    font-size: 1rem;\n    letter-spacing: 0.0125rem;\n    line-height: 1.78;\n    text-align: left;\n    position: relative;\n}\n\n/* Remove bottom padding from last element in the component*/\n.feature-box > *:last-child {\n    padding-bottom: 0;\n    margin-bottom: 0;\n}\n.feature-box > *:last-child li:last-of-type {\n    padding-bottom: 0;\n    margin-bottom: 0;\n}\n</pre>\n</code>\n    \n<h5>Text</h5>\n<code>\n<pre>\n/* Text */\n.feature-box-title {\n    display: flex;\n    margin-bottom: 32px;\n}\n.feature-box h3 {\n    margin: 8px 0 0 0;\n    padding: 0;\n    font-weight: 600;\n    font-style: normal;\n    line-height: 40px;\n    font-size: 32px;\n}\n.feature-box p {\n    line-height: 32px;\n    font-size: 16px;\n    padding: 0 0 32px 0;\n    margin: 0;\n    letter-spacing: 0.0125rem;\n    color: #333;\n    display: inline-block;\n}\n</pre>\n</code>\n    \n<h5>List</h5>\n<code>\n<pre>\n/* List */\n.feature-box ul {\n    padding: 0 0 0 16px;\n    margin: 0;\n    line-height: 1.78;\n    list-style: none;\n}\n.feature-box ul li {\n    padding: 0 0 16px 32px;\n    margin: 0;\n    line-height: 32px;\n    position: relative;\n}\n.feature-box ul li svg {\n    position: absolute;\n    left: 0;\n    top: 10px;\n}\n</pre>\n</code>\n\n<h5>Icon</h5>\n<code>\n<pre>\n/* Icon */\n.feature-box .feature-icon {\n    position: absolute;\n    left: 32px;\n    top: 32px;\n    height: 88px;\n}\n.feature-box .feature-icon svg {\n    width: 88px;\n    height: 88px;\n}\n</pre>\n</code>\n    \n<h5>Media queries</h5>\n<code>\n<pre>\n/* Media queries */\n@media (max-width: 992px) {\n    .feature-box {\n        padding: 32px;\n    }\n    .feature-box h3 {\n        margin: 8px 0 0 16px;\n        font-size: 21px;\n        line-height: 1.33;\n    }\n    .feature-box .feature-icon {\n        position: relative;\n        height: 56px;\n        top:auto;\n        left: auto;\n    }\n    .feature-box .feature-icon svg {\n        width: 56px;\n        height: 56px;\n    }\n}\n@media (max-width: 576px) {\n    .feature-box {\n        padding: 24px;\n    }\n    .feature-box .feature-icon {\n        height: 44px;\n    }\n    .feature-box .feature-icon svg {\n        width: 44px;\n        height: 44px;\n    }\n\n    .feature-box h3 {\n        margin: 4px 0 0 16px;\n        line-height: 1.25;\n        font-size: 21px;\n    }\n}\n</pre>\n</code>\n";$(".feature-box-news-code .css-code").html(featureBoxNewsCss); //DISCLAIMERS
