var tableCss="\n<h5>Table</h5>\n<code>\n<pre>\n/* Table */\n.table {\n  border-collapse: collapse;\n  border-top: 4px solid #d8d8d8;\n  width: 100%;\n  background-color: transparent;\n  margin-bottom: 16px;\n  background-color: #ffffff;\n  overflow-y: hidden;\n  margin-bottom: 32px;\n  overflow-x: auto;\n  font-family: \"Open Sans\", sans-serif;\n  font-style: normal;\n  font-stretch: normal;\n  letter-spacing: normal;\n}\n.table th {\n  font-weight: 600;\n  padding: 16px;\n  border-bottom: 2px solid #dee2e6;\n  border-top: 1px solid #dee2e6;\n  vertical-align: bottom;\n  width: auto;\n  text-align: left;\n  color: #212529;\n}\n.table tr {\n  background-color: #f5f5f5;\n  color: #333;\n  font-size: 14px;\n  line-height: 1.71;\n}\n.table tbody tr {\n  background-color: #fff;\n  border-bottom: 1px solid #f5f5f5;\n}\n.table td {\n  border-top: 1px solid #dee2e6;\n  padding: 0.75rem;\n  vertical-align: top;\n  font-weight: 400;\n  padding: 16px;\n}\n</pre>\n</code>\n     \n<h5>Icon</h5>\n<code>\n<pre>\n/* Icon */\n.arrow-icon {\n  float: right;\n  padding: 0;\n  display: none;\n}\n.showGroup .arrow-icon {\n  transform: scaleY(-1);\n}\n</pre>\n</code>\n\n<h5>Media query</h5>\n<code>\n<pre>\n/* Media Query */\n@media (max-width: 576px) {\n  .table thead tr {\n    position: absolute;\n    top: -9999px;\n    left: -9999px;\n    display: table;\n    width: 100%;\n    border-bottom: solid 1px #d8d8d8;\n  }\n  .table td {\n    display: none;\n    position: relative;\n    white-space: normal;\n    text-align: left;\n    border-top: 0px;\n    padding-left: 45%;\n    font-size: 14px;\n    line-height: 1.4rem;\n    background: #ebebeb;\n  }\n  .table td:first-of-type {\n    background: #ffffff;\n    background-position: right 16px center;\n    background-size: 16px 10px;\n    font-weight: 600;\n    padding-left: 16px;\n    padding-right: 15px;\n    display: block;\n    cursor: pointer;\n  }\n  .table .showGroup td {\n    display: block;\n    transition: all 0.2s;\n    background: #ebebeb;\n  }\n  .table td::before {\n    position: absolute;\n    top: 16px;\n    left: 16px;\n    text-align: left;\n    content: attr(data-title);\n    display: block;\n  }\n  .table td:first-of-type::before {\n    content: \"\";\n  }\n  .table .groupParent td:first-of-type {\n    background-position: right 16px center;\n    background-size: 16px 10px;\n  }\n  .arrow-icon {\n    display: block;\n  }\n}\n</pre>\n</code>\n";$(".table-code .css-code").html(tableCss); //Image
