var anchorMenuCss="\n<h5>Containers</h5>\n<code>\n<pre>\n/* Container */\n.anchor-menu {\n  position: fixed; /* IE11 fix */\n  position: sticky;\n  top: 0; /* adjust with javascript for IE11 */\n  background: #fff;\n  padding: 24px;\n  width: fit-content;\n  display: table; /* IE11 width fix */\n}\n</pre>\n</code>\n\n<h5>Text</h5>\n<code>\n<pre>\n/* Text */\n.anchor-menu h5 {\n  font-size: 18px;\n  line-height: 24px;\n  margin-top: 0;\n  padding-bottom: 20px;\n  font-family: \"Open Sans\", sans-serif;\n  font-weight: 600;\n  font-style: normal;\n  padding: 0 0 16px 0;\n  margin: 0;\n}\n.anchor-menu a {\n  color: #254f90;\n  font-size: 14px;\n  line-height: 20px;\n  font-family: \"Open Sans\", sans-serif;\n  font-weight: 400;\n  font-style: normal;\n  text-decoration: none;\n  box-shadow: none;\n  display: inline-block;\n  border: 1px dotted transparent;\n  transition: box-shadow 0.25s, -webkit-box-shadow 0.25s;\n}\n.anchor-menu a:hover,\n.anchor-menu a:focus {\n  font-weight: 600;\n}\n.anchor-menu a.active-sticky {\n  border: none;\n  border-left: #b3c2d8 solid 4px;\n  padding-left: 16px;\n  font-weight: 600;\n}\n</pre>\n</code>\n\n<h5>List</h5>\n<code>\n<pre>\n/* List */\n.anchor-menu ul {\n  margin: 0;\n  padding: 0;\n}\n.anchor-menu ul li {\n  padding: 0;\n  margin: 0 0 20px 0;\n  height: 20px;\n  position: relative;\n  list-style: none;\n}\n</pre>\n</code>\n\n<h5>Media Query</h5>\n<code>\n<pre>\n/* Media Query */\n@media (max-width: 576px) {\n  .anchor-menu a.active-sticky,\n  .anchor-menu a {\n    border: none;\n    padding-left: 0;\n  }\n}\n</pre>\n</code>\n";$(".anchor-menu-code .css-code").html(anchorMenuCss); //BREADCRUMBS
