var steppedNavigationCss="  \n<h5>Steps</h5>\n<code>\n<pre>\n/* Steps */\n.stepped-navigation {\n  margin: 0;\n  padding: 0;\n  width: 100%;\n  display: flex;\n  align-content: center;\n  justify-content: space-evenly;\n  line-height: 1.78;\n}\n.stepped-navigation li {\n  padding: 40px 8px 0 8px;\n  display: block;\n  position: relative;\n  width: 100%;\n}\n.stepped-navigation li .step-container,\n.stepped-navigation li .step-container .step-name {\n  font-family: \"Open Sans\", sans-serif;\n  font-weight: 400;\n  font-style: normal;\n  text-decoration: none;\n  font-size: 14px;\n  color: #666666;\n  text-align: center;\n  display: inline-block;\n  width: 100%;\n  border: 1px dotted transparent;\n}\n.stepped-navigation li .step-container .step-name {\n  opacity: 0.5;\n}\n.stepped-navigation li .step-container .step-icon {\n  height: 32px;\n  width: 32px;\n  text-decoration: none;\n  border: solid 2.5px #c7c7c7;\n  opacity: 1;\n  border-radius: 50%;\n  background: #ffffff;\n  line-height: 30px;\n  position: absolute;\n  top: 0;\n  left: calc(50% - 18px);\n  z-index: 10;\n}\n.stepped-navigation li .step-container .step-icon:hover,\n.stepped-navigation li .step-container .step-name:hover {\n  cursor: default;\n}\n.stepped-navigation li .step-container .step-icon svg {\n  display: none;\n}\n.stepped-navigation li .step-container .step-icon .step-number {\n  font-family: \"Open Sans\", sans-serif;\n  font-weight: 600;\n  font-style: normal;\n  color: #666666;\n  opacity: 0.5;\n  font-size: 16px;\n  line-height: 32px;\n  padding: 0;\n  margin: 0;\n}\n.stepped-navigation li .step-container:after {\n  content: \"\";\n  position: absolute;\n  top: 18px;\n  left: calc(50% + 16px);\n  width: 100%;\n  height: 2.5px;\n  background: #c7c7c7;\n  z-index: 0;\n}\n.stepped-navigation li:last-of-type .step-container:after {\n  content: \"\";\n  position: absolute;\n  top: 0;\n  left: 0;\n  width: 0;\n  height: 0;\n  background: transparent;\n  z-index: 0;\n}\n</pre>\n</code>\n\n<h5>Completed steps</h5>\n<code>\n<pre>\n/* Completed steps */\n.stepped-navigation li.completed-step .step-container .step-name {\n  font-weight: 600;\n  color: #254f90;\n  opacity: 1;\n}\n.stepped-navigation li.completed-step .step-container .step-icon {\n  border: solid 2.5px #254f90;\n  border-radius: 50%;\n  color: #ffffff;\n  background: #254f90;\n  white-space: nowrap;\n  overflow: hidden;\n  display: flex;\n  align-items: center;\n  justify-content: center;\n  opacity: 1;\n}\n.stepped-navigation li.completed-step .step-container .step-icon .step-number {\n  display: none;\n}\n.stepped-navigation li.completed-step .step-container .step-icon:hover,\n.stepped-navigation li.completed-step .step-container .step-name {\n  cursor: pointer;\n}\n.stepped-navigation li.completed-step .step-container .step-icon svg {\n  display: block;\n}\n.stepped-navigation li.completed-step .step-container:after {\n  background: #254f90;\n}\n</pre>\n</code>\n\n<h5>Current step</h5>\n<code>\n<pre>\n/* Current step */\n.stepped-navigation li.current-step .step-name,\n.stepped-navigation li.current-step .step-container .step-number {\n  font-family: \"Open Sans\", sans-serif;\n  font-weight: 600;\n  font-style: normal;\n  color: #254f90;\n  opacity: 1;\n}\n.stepped-navigation li.current-step .step-container .step-icon {\n  border: solid 2.5px #254f90;\n  opacity: 1;\n  border-radius: 50%;\n}\n</pre>\n</code>\n\n<h5>Media Query</h5>\n<code>\n<pre>\n/* Media Query */\n@media (max-width: 576px) {\n  .stepped-navigation li .step-container .step-name {\n    display: none;\n  }\n}\n</pre>\n</code>\n";$(".stepped-navigation-code .css-code").html(steppedNavigationCss); //CHECKLIST
