var globalFooterCss="\n<h5>Containers</h5>\n<code>\n<pre>\n/* Containers */\n.footer-navigation {\n  display: flex;\n  justify-content: center;\n  align-content: center;\n  background: #254f90;\n}\n.footer-navigation-content {\n  padding: 64px 32px;\n  max-width: 1140px;\n  width: 100%;\n  display: flex;\n  flex-direction: column;\n}\n.footer-navigation-content-top {\n  display: flex;\n  justify-content: space-between;\n  align-content: center;\n}\n.footer .links-group-column {\n  display: flex;\n  flex-direction: column;\n  justify-content: flex-start;\n  width: 100%;\n}\n.footer-navigation-content-bottom {\n  display: flex;\n  flex-wrap: wrap;\n  margin-top: 48px;\n  justify-content: flex-end;\n  align-items: center;\n}\n.footer-note {\n  background: #18335c;\n  display: flex;\n  justify-content: center;\n}\n.footer-note-content {\n  max-width: 1140px;\n  width: 100%;\n  display: flex;\n  flex-direction: column;\n  padding: 64px 32px;\n}\n</pre>\n</code>\n\n<h5>Site navigation links</h5>\n<code>\n<pre>\n/* Site navigation links */\n.footer .links-group-column ul {\n  padding: 16px 16px 0 16px;\n  margin: 0;\n  width: 100%;\n}\n.footer .links-group-column ul li {\n  list-style: none;\n  line-height: 24px;\n  display: flex;\n  padding: 0 0 16px 0;\n  width: 100%;\n}\n.footer .links-group-column ul li .link-svg-container {\n  height: 16px;\n  width: 16px;\n  right: 16px;\n  top: 4px;\n  transition: all 0.2s ease;\n  display: flex;\n  align-items: center;\n  line-height: 0;\n  position: relative;\n  fill: #ffffff;\n}\n.footer .links-group-column ul li a {\n  text-decoration: underline;\n  color: #ffffff;\n  font-family: \"Open Sans\", sans-serif;\n  font-size: 16px;\n  font-weight: 400;\n}\n.footer .links-group-column ul li a:hover,\n.footer .links-group-column ul li a:focus {\n  font-weight: 600;\n}\n.footer .links-group-column h3 {\n  font-weight: 600;\n  font-size: 1.5rem;\n  padding: 0;\n  color: #ffffff;\n  font-style: normal;\n  font-stretch: normal;\n  letter-spacing: 0;\n  margin: 0;\n  line-height: 1.33;\n  font-family: \"Open Sans\", sans-serif;\n}\n/* Newsletter subscribe button */\n.footer .newsletter-subscribe-button {\n  background-color: #4569a0;\n  border: 2px solid #fff;\n  border-radius: 6px;\n  box-shadow: 0 2px 4px 0 rgba(0, 0, 0, 0.1);\n  line-height: 3rem;\n  padding: 0 1rem;\n  transition: all 0.4s ease;\n  text-decoration: none;\n  display: inline-block;\n  cursor: pointer;\n  margin-right: auto;\n}\n.footer .newsletter-subscribe-button span {\n  color: #ffffff;\n  font-weight: 600;\n  font-size: 1.125rem;\n  padding-right: 8px;\n  font-family: \"Open Sans\", sans-serif;\n}\n.footer .newsletter-subscribe-button-svg-container {\n  display: inline-block;\n  line-height: 0;\n  top: 3px;\n  position: relative;\n}\n.footer .newsletter-subscribe-button-svg-container svg {\n  fill: #ffffff;\n  height: 16px;\n  width: 16px;\n}\n.footer .newsletter-subscribe-button:hover,\n.footer .newsletter-subscribe-button:focus {\n  background-color: #fff;\n  box-shadow: 0 4px 8px 0 rgba(0, 0, 0, 0.3);\n  transform: translate(0, -0.25rem);\n}\n.footer .newsletter-subscribe-button:hover span,\n.footer .newsletter-subscribe-button:focus span {\n  color: #254f90;\n}\n.footer .newsletter-subscribe-button:hover svg,\n.footer .newsletter-subscribe-button:focus svg {\n  fill: #254f90;\n}\n</pre>\n</code>\n\n<h5>Social links</h5>\n<code>\n<pre>\n/* Social links */\n.footer .social-links {\n  display: flex;\n  line-height: 48px;\n  padding: 0;\n  margin-left: 16px;\n  list-style: none;\n}\n.footer .social-links .social-link-circle {\n  border: 2px solid #fff;\n  background-color: #4569a0;\n  border-radius: 50%;\n  width: 2.75rem;\n  height: 2.75rem;\n  display: flex;\n  justify-content: center;\n  align-items: center;\n  margin-right: 1rem;\n  transition: all 0.4s ease;\n  box-shadow: 0 2px 4px 0 rgba(0, 0, 0, 0.1);\n  padding-bottom: 0;\n}\n.footer .social-links .social-link-circle svg {\n  fill: #fff;\n  height: 1rem;\n  width: 1rem;\n}\n.footer .social-links .social-link-circle:hover,\n.footer .social-links .social-link-circle:focus {\n  background-color: #fff;\n  transform: translate(0, -0.25rem);\n  box-shadow: 0 2px 4px 0 rgba(0, 0, 0, 0.3);\n}\n.footer .social-links .social-link-circle:hover svg,\n.footer .social-links .social-link-circle:focus svg {\n  fill: #254f90;\n}\n</pre>\n</code>\n\n<h5>Contact number</h5>\n<code>\n<pre>\n/* Contact number */\n.footer .contact-number {\n  color: #fff;\n  font-weight: 600;\n  text-decoration: none;\n  font-size: 1.5rem;\n  line-height: 3rem;\n  margin-left: 1rem;\n  margin-bottom: 0;\n  font-family: \"Open Sans\", sans-serif;\n}\n</pre>\n</code>\n\n<h5>Footer note</h5>\n<code>\n<pre>\n/* Footer note */\n.footer-note-content p {\n  font-size: 1rem;\n  margin-top: 2rem;\n  margin-bottom: 0;\n  padding-bottom: 0;\n  line-height: 2rem;\n  color: #fff;\n  padding: 0;\n  letter-spacing: 0.0125rem;\n  text-align: left;\n  font-family: \"Open Sans\", sans-serif;\n}\n</pre>\n</code>\n\n<h5>Media queries</h5>\n<code>\n<pre>\n/* Media querires */\n@media (max-width: 1024px) {\n  .footer .links-group-column ul li a {\n    font-size: 0.875rem;\n    margin-left: -0.5rem;\n  }\n  .footer .newsletter-subscribe-button {\n    margin-bottom: 32px;\n  }\n  .footer .contact-number {\n    margin-right: auto;\n    margin-left: 0;\n  }\n  .footer .social-links {\n    justify-content: space-evenly;\n    align-self: flex-start;\n    width: 50%;\n    margin: 0;\n  }\n}\n@media (max-width: 576px) {\n  .footer-navigation {\n    padding: 0 15px;\n  }\n  .footer-navigation-content-top {\n    flex-direction: column;\n    margin-bottom: 32px;\n  }\n  .footer .links-group-column {\n    margin-top: 40px;\n  }\n  .footer-navigation-content {\n    padding: 1.5rem 0.5rem 4rem 0.5rem;\n  }\n  .footer .links-group-column ul li a {\n    font-size: 16px;\n    margin-left: 0;\n  }\n  .footer-navigation-content-bottom {\n    flex-direction: column;\n    align-content: flex-start;\n  }\n  .footer .social-links {\n    justify-content: flex-start;\n    width: 100%;\n    margin-bottom: 32px;\n  }\n  .footer .social-links .social-link-circle {\n    margin-right: 32px;\n  }\n}\n</pre>\n</code>\n";$(".global-footer-code .css-code").html(globalFooterCss); //GLOBAL-HEADER
